import { Col } from "antd";

const InputGroup = ({ md, type, id, placeholder, value }) => {
  return (
    <Col md={md}>
      <div className="input-group">
        <label htmlFor={id}>Category</label>
        <input
          className="form-input"
          type={type}
          id={id}
          placeholder={placeholder}
          value={value}
        />
      </div>
    </Col>
  );
};

export default InputGroup;
